import React from 'react';

const taskWrapperStyle = {
    backgroundColor: "#ffffce",
    height: "40px",
    width: "40%",
    margin: "10px auto",
    border: "4px solid #fcfcb0",
    fontFamily: "Brush Script MT",
}

class Task extends React.Component {

    render() {
        return (
            <div style={taskWrapperStyle}>
                <p>Task 1</p>
            </div>
        );
    }
}

export default Task;
